import React from 'react';
import styled from 'styled-components';
import { NAV_HEIGHT, CONTENT_WIDTH } from '../../data';
import { useSelector } from 'react-redux';

interface Props {}
const UpperNav = styled.div`
  border: red solid 1px;
  height: ${NAV_HEIGHT};
  width: 100%;
  position: absolute;
  top: ${props => (props.topNavDisplay ? true : false)};
`;

const Container = styled.div`
  height: 100%;
  width: 100%;
  max-width: ${CONTENT_WIDTH}; /*For margins*/
  margin: auto; /*For margins*/
  display: flex;
  align-items: center;
  justify-content: space-between;
  border: green solid 1px;
  box-sizing: border-box;
`;
const Nav: React.FC<Props> = () => {
  let displayNav = useSelector<boolean>(state => state.topNavDisplay);
  return (
    <UpperNav displayNav={displayNav}>
      <Container>
        <div>nav Bar</div>
        <div>nav Bar</div>
      </Container>
    </UpperNav>
  );
};

export default Nav;
